import React from 'react';
import {makeStyles, withStyles} from '@material-ui/core';

const styles = makeStyles({
    sideMenu: {
        display: 'flex',
        flexDirection: 'column',
        position: 'absolute',
        left: '0px',
        width: '320px',
        height: '100%',
        backgroundColor: '#253053',
    },
});

const SideMenu = (): any => {
    return (
        <div className="side-menu" >
        </div>
    );
}

export default SideMenu;
